(638, NULL, 'entrada', '55719178077214530547', 'texto', '🔵 *Bela Vista* \n\nApartamento novo com 70m² 3 quartos -\n\nValor R$ R$ 660.000\n\nCondomínio R$ 620\n\nIPTU R$ 300\n\nApartamento 3 quartos  Bela Vista. Nascente, varanda, super ventilado, suite, armários na cozinha e banheiros, infraestrutura de lazer completa.\n\nRef:3467ed', 'false_557191780772-1453054742@g.us_AC85537EC879A4A5ECEB2D30392761BC_131056648851558@lid', 'recebido', NULL, '2025-12-30 17:03:28', '2025-12-30 17:03:28'),
(639, NULL, 'entrada', '55719178077214530547', 'texto', '🟢 *Armação* \nOportunidade de Ap em Armação 39 m2 a 250 metros da praia\nValor R$ 215.000\nCondomínio\nR$ 600 / mês\nIPTU R$ 52\n\nApartamento 39 m2, nascente,\nQuarto e sala, \nbanheiro, \ncozinha integrada com área de serviço , com uma vaga de garagem,\nvaranda com vista pra piscina , garagem e área verde\nPisos em porcelanato polido, com banheiro reformado todo em porcelanato (piso e paredes).\nParede da sala com revestimento e porcelanato.\n\nÁrea de lazer com piscina, área gourmet para churrasco com banheiro integrado .\n\nRef\"', 'false_557191780772-1453054742@g.us_ACF47E525B79BC449864017C7DFE4AC4_131056648851558@lid', 'recebido', NULL, '2025-12-30 17:03:29', '2025-12-30 17:03:29'),
(640, NULL, 'entrada', '55719178077214530547', 'texto', '🟢 *Itaigara* \nCobertura exclusiva no Alto Itaigara, em Salvador,totalmente reformado, com padrão das melhores coberturas de São Paulo e planta inspirada nas coberturas americanas de Nova York.\n\nApartamento · 270m² · 3 quartos (1 suíte master com closet) · dependência · 3 vagas soltas\nVenda: R$ 1.733.000\nCondomínio: R$ 2.900 · IPTU: R$ 850\n\nDestaques: vista panorâmica .\n1º andar (dia-a-dia): 3/4 (1 suíte master com closet), cozinha principal, dependência, e sala ampla de recepção.\n2º andar (festas e lazer): espaço aberto que pode ser transformado em salão para 50 pessoas, 2ª cozinha independente com ilha americana, e sala principal com grandes janelas e vista permanente da cidade.\n\nRooftop integrado dentro do apartamento: lareira ao ar livre, cinema ao céu aberto, piscina, jardim no rooftop – ambiente amplo e exclusivo de lazer privativo.\nCondomínio completo com lazer: academia ampla com 30+ equipamentos, piscina aquecida interna, piscina externa, brinquedoteca, salão de festas, quadras e outros itens de lazer. \n\nRef;ped4944', 'false_557191780772-1453054742@g.us_ACC99EC385DDEFCF33C26A6DC88545FA_131056648851558@lid', 'recebido', NULL, '2025-12-30 17:03:29', '2025-12-30 17:03:29'),
(641, NULL, 'entrada', '55719178077214530547', 'texto', '🟢 *Costa Azul* \n3 quartos \nValor R$ 415.000\nCondomínio\nR$ 769 / mês\nIPTU R$ 1.300\n\nApartamento de 78m², super bem distribuídos, perfeito para quem busca conforto, praticidade e aquele visual que faz toda a diferença.\n- 3 quartos, sendo 1 suíte\n- 2 banheiros\n- Armários planejados em todos os cômodos (é só chegar e morar!)\n- Ambientes bem iluminados e ventilados\n- Prédio sem elevador\n\nVista para o mar, para começar e terminar o dia com energia boa.\n\nRef:8888ve', 'false_557191780772-1453054742@g.us_ACB484A22FA23CA7D48BA602C7673B5C_131056648851558@lid', 'recebido', NULL, '2025-12-30 17:03:29', '2025-12-30 17:03:29'),
