(867, NULL, 'entrada', '120363424969304388', 'texto', '⚠️ *Depois de amanhã, não tem mais como entrar*\n\nDev, *o Combo 3 em 1 está nos últimos momentos de venda.*\n\n Após o encerramento, não será possível comprar depois, nem por outro valor. ❌\n\nSe isso faz sentido pra você, *não deixa pra última hora.* ⏳\n\n_Garanta seu acesso agora_\n👉🏻 https://www.fullstackclub.com.br/combo3em1', 'false_120363424969304388@g.us_3EB0631B96D119B38F3DC9C082429184CCF2C998_135867549147160@lid', 'recebido', NULL, '2025-12-30 20:00:09', '2025-12-30 20:00:09'),
