(981, NULL, 'entrada', '', 'texto', 'O SINDSEMP-BA presente em toda a Bahia! 📸✨\n\nSabemos que a distância geográfica é grande, mas a nossa união é ainda maior. Por isso, o SINDSEMP-BA fez questão de apoiar e patrocinar as confraternizações dos servidores filiados em diversas regionais do interior do estado.\n\nEmbora a diretoria não consiga estar fisicamente em todos os encontros, nosso coração e nosso compromisso estão com cada colega. Essas celebrações fortalecem o sentimento de pertencimento e reafirmam que o sindicato é feito por todo', 'false_status@broadcast_A59F6D5EDC7F9B56E81E5FFF9BB5B4FB_557193231002@c.us', 'recebido', NULL, '2025-12-30 22:18:49', '2025-12-30 22:18:49'),
